@UncheckedAccess

FUNCTION Check_Sites_Exist (
   as_pred_config_id_ NUMBER ) RETURN VARCHAR2
IS
   temp_ VARCHAR2(5);
BEGIN
   IF (as_pred_config_id_ IS NULL) THEN
      RETURN NULL;
   END IF;

   SELECT 'TRUE'
   INTO temp_
   FROM as_pred_conf_equip_mapping
   WHERE as_pred_config_id = as_pred_config_id_
   AND rownum = 1;

   RETURN temp_;
EXCEPTION
   WHEN no_data_found THEN
      RETURN 'FALSE';
END Check_Sites_Exist;
